import { useState } from 'react';
import {
  Box,
  Typography,
  Hidden,
  Container,
  Button,
  Grid
} from '@mui/material';
import TextField from '@mui/material/TextField';
import { Helmet } from 'react-helmet-async';
import RefreshTwoToneIcon from '@mui/icons-material/RefreshTwoTone';
import LoadingButton from '@mui/lab/LoadingButton';

import { styled } from '@mui/material/styles';

const GridWrapper = styled(Grid)(
  ({ theme }) => `
    background: ${theme.colors.gradients.black1};
`
);

const MainContent = styled(Box)(
  () => `
    height: 100%;
    display: flex;
    flex: 1;
    overflow: auto;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
);

const TypographyPrimary = styled(Typography)(
  ({ theme }) => `
      color: ${theme.colors.alpha.white[100]};
`
);

const TypographySecondary = styled(Typography)(
  ({ theme }) => `
      color: ${theme.colors.alpha.white[70]};
`
);

const divStyle = {
  backgroundImage: 'url(/static/images/bg5-4.jpg)',
  minheight: '100vh',
  width: '100%',
  backgroundRepeat: 'no-repeat',
  backgroundPosition: 'center center',
  backgroundSize: 'cover',
  padding: '40px'


};


function Status500() {

  const [pending, setPending] = useState(false);
  function handleClick() {
    setPending(true);
  }

  return (
    <>
      <Helmet>
        <title>Inabia - ediscovery</title>
      </Helmet>
      <MainContent>
        <Grid
          container
          sx={{ height: '100%' }}
          alignItems="stretch"
          spacing={0}
        >
          <Hidden mdDown>

            <GridWrapper
              xs={12}
              md={6}
              alignItems="center"
              display="flex"
              className='login-bg'
              style={divStyle}
              justifyContent="center"
              item
            >


              <Container maxWidth="lg" >
                <Box textAlign="left">
                  <TypographyPrimary variant="h1" sx={{ my: 1}}
                  fontSize="40px"
                  fontWeight="lighter"
                  letterSpacing="1px">
                  Welcome to 
                  </TypographyPrimary>

                  <TypographyPrimary variant="h1" sx={{ my: 1 }}
                  fontSize="40px"
                  letterSpacing="1px"
                  >
                  <b>INABIA EBOT</b>
                  </TypographyPrimary>
                  <TypographySecondary
                    variant="h4"
                    fontWeight="normal"
                    sx={{ mb: 4 }}
                    color="#fff"
                  >

                    Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua
                  </TypographySecondary>

                </Box>
              </Container>

            </GridWrapper>

          </Hidden>

          <Grid
            xs={12}
            md={6}
            alignItems="center"
            display="flex"
            justifyContent="center"
            item
          >
            <Container maxWidth="sm">

              <Box textAlign="center">
                <img
                  alt="500"
                  height={100}
                  src="/static/images/inabia_ai_logo.png"
                />
                <TextField
                      id="email"
                      name="email"
                      label="Email"
                      type="email"
                      autoComplete="current-email"
                    />

            <TextField
                      id="password"
                      name="password"
                      label="Password"
                      type="password"
                      autoComplete="current-password"
                    />
                <Typography variant="h2" sx={{ my: 2 }}>
                  There was an error, please try again later
                </Typography>
                <Typography
                  variant="h4"
                  color="text.secondary"
                  fontWeight="normal"
                  sx={{ mb: 4 }}
                >
                  The server encountered an internal error and was not able to complete your request
                </Typography>
                {/* <LoadingButton
                  onClick={handleClick}
                  loading={pending}
                  variant="outlined"
                  color="primary"
                  startIcon={<RefreshTwoToneIcon />}
                >
                  Refresh view
                </LoadingButton> */}
                <Button href="/register" variant="contained" sx={{ ml: 1 }}>
                  Signin
                </Button>
              </Box>
            </Container>
          </Grid>
        </Grid>
      </MainContent>
    </>
  );
}

export default Status500;
